Aetheric Mechanics - A graphic novella (Warren Ellis)

The newest addition to Warren Ellis Apparat line of original graphic novels has arrived! The year is 1907, and Britain has entered into a terrifying war with Ruritania, whose strange metal planes darken the skies, and whose monstrous war engines cast looming shadows from across the channel. Doctor Robert Watcham, lately returned to London from the front, makes his homecoming to Dilke Street. There lives his old friend, and England's greatest amateur detective, Sax Raker. Even as his beloved city prepares for war, Raker is himself about to embark on the strangest (and, perhaps, the most important) investigation of his career: The case of the man who wasnt there. This is no simple matter of murder - Sax Raker faces haunting questions to which there are no cut and dried answers. Is the mysterious killer, at last, evidence for Raker's long-held belief in a secret criminal mastermind? Is it some apparition uniquely belonging to this singular city, a place that seems to have lost all semblance of sense two years ago? Or do all the signs point to something much, much worse?


